        setInputData(e.target.value);
    };

    return (
        <div className='add_task-container'>
            <input
                onC
                className='add_task-input' 
                type="text" 
                name="include" 
                id="addText" />
            <Button>GET STARTED</Button>
        </div>
    );
}

